import Axios from 'axios';

import { GET_ALL_OUTCOMES, GET_ERRORS,GET_MEASURES } from './types';


export const getOutcome = (CycleId) => dispatch => {
    Axios.get("/api/outcome/"+`${CycleId}`)
        .then(res =>{
            dispatch({
                type:  GET_ALL_OUTCOMES,
                payload: res.data
            })


        })

        .catch(err => {
            dispatch({
                type: GET_ERRORS,
                payload: err.data
            })
        })
}

export const getMeasure = (OutcomeId) => dispatch => {
    Axios.get('/outcome/measure/'+`${OutcomeId}`)
        .then(res =>{
            dispatch({
                type:  GET_MEASURES,
                payload: res.data
            })


        })

        .catch(err => {
            dispatch({
                type: GET_ERRORS,
                payload: err.data
            })
        })
}
